def sort_list_of_dict(l):
    '''
    l是一个列表。里面的元素全都是dict。
    '''
    lnew = []
    for d in l:#json.dumps(old_dict, ensure_ascii=False).encode('utf8').decode()
        lnew.append(json.dumps(d, ensure_ascii=False).encode('utf8').decode())
    lnew.sort()
    lnew_d = []
    for l in lnew:
        lnew_d.append(json.loads(l))
    return lnew_d

def same_dict(dic1, dic2):
    ## 如果直接可以判断，那就直接判断
    if dic1 == dic2:
        return True
    ## key都不一样，就直接GG了
    if sorted(list(dic1.keys())) != sorted(list(dic2.keys())):
        print("keys are not the same")
        return False
    ## 进到里面去看
    rsts = []
    for key in dic1:
        val1 = dic1[key]
        val2 = dic2[key]
        ## 类型都不一样，直接GG了
        if type(val1) != type(val2):
            return False
        if isinstance(val1, dict):
            rsts.append(same_dict(val1, val2))
        elif isinstance(val1, list):
            if len(val1) != len(val2):
                return False
            val1_ = sort_list_of_dict(val1)
            val2_ = sort_list_of_dict(val2)
            for v1, v2 in zip(val1_, val2_):
                if not same_dict(v1, v2):
                    return False
            rsts.append(True)
        else:
            rsts.append(val1 == val2)
    return False if False in rsts else True

